import React from 'react';

function HexCell({ tile, onClick }) {
  return (
    <div className="hex-cell" onClick={onClick}>
      {tile && (
        <>
          <div className="vertical">{tile.vertical}</div>
          <div className="lower-right">{tile.lowerRight}</div>
          <div className="upper-left">{tile.upperLeft}</div>
        </>
      )}
    </div>
  );
}

export default HexCell;
